import {
  formatCurrency,
  formattedDateTime,
  formattedFullDateTime,
} from "./helper";

export function printReceipt(receivedOrderedItem) {
  // Create an iframe
  const iframe = document.createElement("iframe");
  iframe.style.position = "absolute";
  iframe.style.top = "0";
  iframe.style.left = "-1000px"; // Hide it off-screen
  iframe.style.width = "0px";
  iframe.style.height = "0px";
  iframe.style.border = "none";
  document.body.appendChild(iframe);

  const doc = iframe.contentWindow.document;

  // Ensure the document is fully ready before modifying
  doc.open();
  doc.write(
    "<html><head><title>Order Receipt</title></head><body></body></html>"
  );
  doc.close();

  const head = doc.head;
  const body = doc.body;

  // Add styles
  const style = doc.createElement("style");
  style.textContent = `
    body { font-family: 'Times New Roman', sans-serif; font-size: 12px; margin: 0px; box-sizing: border-box; }
    .center { text-align: center; }
    .order_item > div { display: flex; justify-content: center; margin-bottom: 1px; align-items: center; gap: 40px;}
    .total { margin-top: 10px; font-weight: bold; }
    .footer_text { text-align: center; margin-top: 15px; font-size: 10px; }
    hr {
      border: none; /* Remove default border */
      border-top: 0.5px dashed #000; /* Thinner dashed line */
      margin: 10px 0; /* Reduce space if needed */
    }
    p { margin: 2px 0; line-height: 1.2; } 
    .center div { margin-top: 20px;}
  `;
  head.appendChild(style);

  // Header
  const header = doc.createElement("header");
  header.classList.add("center");
  header.innerHTML = `
    <div>
 <img src="data:image/png;base64," style="height:30px">
   
    <p style="margin-top:15px;font-weight:500;font-size:12px">+91 86388 92886</p>
    <p style="margin-top:3px;font-weight:500;font-size:10px">www.zerocarbs.in</p>
    <p style="margin-top:3px;font-weight:500;font-size:10px;line-height:10px">
      House No. 5, Nilomani Road, Christian Basti, Guwahati, Assam 781005
    </p>
    <p style="margin-top:3px;font-weight:500;font-size:10px">FSSAI Lic. No.</p>
    <p style="font-weight:500;font-size:10px">20324103000048</p>
    </div>
    <hr />
  `;
  body.appendChild(header);

  // Date Section
  const dateSection = doc.createElement("section");
  dateSection.classList.add("center");
  dateSection.innerHTML = `
    <p>${formattedFullDateTime(receivedOrderedItem?.updated_at)}</p>
    <hr />
  `;
  body.appendChild(dateSection);

  // Nutritional Info
  const nutritionSection = doc.createElement("section");
  nutritionSection.classList.add("center");
  nutritionSection.innerHTML = `
    <h2><span style="font-weight: bold;">kcla</span> <span style="font-weight: lighter;">340</span></h2>
    <p>
      <span>Carbs <span style="font-weight: bold;">109g</span> | </span>
      <span>Protein <span style="font-weight: bold;">30g</span> | </span>
      <span>Fats <span style="font-weight: bold;">9g</span></span>
    </p>
    <hr />
  `;
  body.appendChild(nutritionSection);

  // Order Summary
  const orderContainer = doc.createElement("section");
  // Add the heading only once
  const orderHeading = document.createElement("p");
  orderHeading.textContent = "Order Summary";
  orderHeading.style.fontWeight = "bold";
  orderHeading.style.textAlign = "center";
  orderHeading.style.fontSize = "20px";
  orderContainer.appendChild(orderHeading);

  const items = receivedOrderedItem?.order_summary;

  items?.forEach((itm) => {
    const addonItems = JSON.parse(itm?.addon_data)[0]?.items || [];
    const formattedAddons = addonItems
      .map((addon) => `${addon.quantity} x ${addon.addon_item_name}`)
      .join(", ");

    const addonItemTotalPrice = addonItems.reduce(
      (acc, addon) => addon.total + acc,
      0
    );
    const orderItem = doc.createElement("div");
    orderItem.classList.add("order_item");
    orderItem.innerHTML = `
      <div>
        <div style="
          display: grid; 
          grid-template-columns: 2fr 1fr;  
      
          align-items: start; 
          justify-items: center;
          padding: 3px 0;
          width: 30%; /* Adjust for good spacing on left & right */
        ">
          <div>
          <p style="margin: 0; justify-self: start;">${
            itm?.qty + " &times; " + itm?.item[0]?.name
          }</p>
          <p style="margin-top: 2px; justify-self: start;"><span style="font-weight: bold;">Add On:</span><span>${formattedAddons}</span></p>
          </div>
          <p style="margin: 0; font-weight: bold;">${formatCurrency(
            +itm?.price + addonItemTotalPrice
          )}</p>
        </div>
      </div>
    `;
    orderContainer.appendChild(orderItem);
  });

  // Add Tax, Discount, and Delivery
  const chargesContainer = document.createElement("div");
  chargesContainer.style.width = "30%";
  chargesContainer.style.margin = "10px auto 0";
  chargesContainer.innerHTML = `
  <hr />
  <div style="
    display: grid;
    grid-template-columns: 2fr 1fr;
    align-items: center;
    justify-items: center;
    padding: 5px 0;
  ">
    <p style="margin: 0; justify-self: start;">Tax</p>
    <p style="margin: 0; font-weight: bold;">${formatCurrency(
      receivedOrderedItem?.tax_amount
    )}</p>

    <p style="margin: 0; justify-self: start;">Packing Charges</p>
    <p style="margin: 0; font-weight: bold;">${formatCurrency(
      receivedOrderedItem?.packaging_charge
    )}</p>

    <p style="margin: 0; justify-self: start;">Discount</p>
    <p style="margin: 0; font-weight: bold;">-${formatCurrency(
      receivedOrderedItem?.discount || 0
    )}</p>

    <p style="margin: 0; justify-self: start;">Total</p>
    <p style="margin: 0; font-weight: bold;">${formatCurrency(
      receivedOrderedItem?.grand_total || 25
    )}</p>
    
  </div>
  <hr />
`;

  // Append to Order Container
  orderContainer.appendChild(chargesContainer);

  body.appendChild(orderContainer);

  // Total & Payment Section

  // Footer
  const footer = doc.createElement("footer");
  footer.classList.add("footer_text");
  footer.innerHTML = `<hr /> <p>This is not a tax invoice</p>`;
  body.appendChild(footer);

  // Ensure iframe content is loaded before printing
  setTimeout(() => {
    iframe.contentWindow.focus();
    iframe.contentWindow.print();
  }, 200);

  // Remove iframe after printing
  iframe.contentWindow.onafterprint = function () {
    document.body.removeChild(iframe);
  };
}
